  // Increments i (i.e., set i+1 to i).
  define_syntax("inc!", function(x){
    var target = x.cdr.car;
    return List(Sym("begin"),
                List(Sym("set!"),
                     target, 
                     List(Sym("+"), target, 1)),
                target);
  });
  
  // (dec! i)
  // = (begin (set! i (- i 1)) i)
